  \"Liver Contaminants in Bald eagles Carcasses from Maine\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 8,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:42:09.110595\",\n\t\"name\": \"liver-contaminants-in-bald-eagles-carcasses-from-maine\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Fifty-one livers were extracted from bald
  eagle carcasses recovered in Maine between 2001 and 2007. Approximately 50% of the
  birds were collected during the spring months (March May) with the remaining carcasses
  being recovered equally among the other three seasons. Causes of death included
  electrocution, collisions, gunshot, lightning, and starvation; but the majority
  died of undetermined causes. Qualitative estimates of body condition based on muscle
  mass and subcutaneous and intra-abdominal fat content suggested that 69% of the
  birds were in poor physical condition. Total PCB (Arithmetic mean 27.32 u00b1 90.40
  u00ecg/g wet weight, max. 570 u00ecg/g ww) and DDE (3.46 u00b1 9.66 u00ecg/g ww,
  max. 64.2 u00ecg/g ww) were detected in all samples. Average concentrations by month
  of collection appeared similar for both compounds with the highest levels recorded
  in May and September. Three eagles had PCB liver levels indicative of acute toxicity
  (> 100 u00ecg/g ww). DDE liver levels did not approach acute toxicity thresholds.
  Mercury (Arithmetic mean Hg, 23.04 u00b1 30.45 u00ecg/g dry weight) and lead (Pb,
  13.21 u00b1 32.96 u00ecg/g dw) were also detected in all samples. Thirty-three livers
  had low Hg levels ( 80 u00ecg/g dw) including one with 191 u00ecg Hg/g dw. Liver
  Hg varied by month with no apparent pattern among season of collection. Forty-three
  liver samples exhibited low Pb levels (= 6 u00ecg/g dw), but eight had concentrations
  indicative of Pb poisoning (> 30 u00ecg/g dw). Two livers had Pb levels in excess
  of 130 u00ecg/g dw. The highest Pb concentrations were detected in birds recovered
  during the winter and spring months. Although the bald eagle has been removed from
  the U.S. and some state endangered species lists, environmental contaminants may
  still be pose a threat and accumulate to toxic levels in some birds. The USFWS post-delisting
  monitoring strategy encourages periodic evaluations of trends in bald eagle abundance
  and contaminants exposure in vulnerable regions.\",\n\t\"license_title\": \"License
